The location at The Highlands at Scotland Yards offers retired residents an opportunity to live within a small town that provides a safer, more affordable alternative to high similar high-quality, age-restricted communities located closer to the Tampa area.
In addition to The Highlands’ exceptional on-site amenities, our property adjoins one of the area’s most popular public golf courses, Scotland Yard Golf Club and “The Yards” Pub and Restaurant where locals love to meet after an invigorating golf game.
Our community is located on Gall Boulevard (US 301) which is a major north/south throughfare that provides access to area retailers such as Walmart, Publix and other local and national retailers as well as Advent Heath Hospital both in Dade City and nearby Zephyrhills.
